import { Navigate, redirect } from 'react-router-dom'

function Logout() {
    async e => {
        e.preventDefault();
        await fetch("http://localhost:8000/api/logout",
            {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                credentials: 'include',
            })
    }
    if (redirect) {
        return <Navigate to="/" />
    }
    return (
        <div> Successfully Logged Out</div>
    );
}
export default Logout
